  \"An evaluation of productivity and mortality factors influencing goose populations:
  A status report of the 1983 waterfowl effort on the Yukon Delta NWR, Alaska: Summary
  report, 1983\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
