  \"an-evaluation-of-productivity-and-mortality-factors-influencing-goose-populations-a-status\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Seven field camps (North Marshall, Kokechik
  West, Tutakoke, Manokinak, White-front Survey, Kigigak Island and South Nelson Island)
  documented the nesting chronology, predation and productivity of four species of
  geese on the Yukon-Kuskokwim delta from April 27th to July 15th, 1983. The primary
  objectives of this study were to monitor productivity and to determine the impact
  of animal and human predations on goose populations on the delta. Species included
  brant, cacklers, emperor geese, and white-front geese.\",\n\t\"license_title\":
